import React, { useState, useCallback, useEffect } from 'react';
import { Card, CardContent, CardHeader, CardTitle } from './ui/card';
import { Button } from './ui/button';
import { Upload, FileText, AlertCircle, CheckCircle, X, Trash2 } from 'lucide-react';
import { parseAlpineTXT, parseMultipleAlpineReports, analyzeCustomerProgress, AlpineSalesRecord } from '../utils/alpineParser';
import { 
  saveInvoiceToSession, 
  removeInvoiceFromSession, 
  getSessionData, 
  clearSessionData,
  StoredInvoice 
} from '../utils/sessionStorage';

interface AlpineReportUploadProps {
  onDataParsed: (data: {
    records: AlpineSalesRecord[];
    customerProgressions: Map<string, any>;
  }) => void;
  onClearData: () => void;
}

interface AlpineFileState {
  file: File | null;
  period: string; // YYYY-MM format
  content: string;
}

const AlpineReportUpload: React.FC<AlpineReportUploadProps> = ({ 
  onDataParsed, 
  onClearData 
}) => {
  const [reports, setReports] = useState<AlpineFileState[]>([]);
  const [storedInvoices, setStoredInvoices] = useState<StoredInvoice[]>([]);
  const [isProcessing, setIsProcessing] = useState(false);
  const [errors, setErrors] = useState<string[]>([]);

  // Load stored invoices on component mount
  useEffect(() => {
    const sessionData = getSessionData();
    setStoredInvoices(sessionData.invoices);

    // If we have stored invoices, process them and notify parent
    if (sessionData.invoices.length > 0) {
      const allRecords = sessionData.invoices.flatMap(invoice => invoice.data.records);
      const customerProgressions = new Map();

      // Analyze customer progressions
      const uniqueCustomers = Array.from(new Set(allRecords.map(r => r.customerName)));
      uniqueCustomers.forEach(customer => {
        const progress = analyzeCustomerProgress(allRecords, customer);
        customerProgressions.set(customer, progress);
      });

      onDataParsed({
        records: allRecords,
        customerProgressions
      });
    }
  }, [onDataParsed]);

  const handleFileUpload = useCallback(async (file: File, period: string) => {
    try {
      const content = await file.text();

      // Add to reports
      const newReport: AlpineFileState = {
        file,
        period,
        content
      };

      setReports(prev => [...prev, newReport]);

    } catch (error) {
      setErrors(prev => [...prev, `Error reading ${file.name}: ${error}`]);
    }
  }, []);

  const processReports = useCallback(async () => {
    if (reports.length === 0) return;

    setIsProcessing(true);
    setErrors([]);

    try {
      // Parse all reports
      const parsedReports = reports.map(report => ({
        content: report.content,
        period: report.period
      }));

      const data = parseMultipleAlpineReports(parsedReports);

      // Create stored invoice for each report
      const newInvoices: StoredInvoice[] = reports.map((report, index) => ({
        id: `${Date.now()}-${index}`,
        fileName: report.file?.name || 'Unknown',
        period: report.period,
        uploadDate: new Date().toISOString(),
        data: parseAlpineTXT(report.content, report.period)
      }));

      // Save each invoice to session storage
      newInvoices.forEach(invoice => {
        saveInvoiceToSession(invoice);
      });

      // Update local state
      setStoredInvoices(prev => [...prev, ...newInvoices]);

      // Analyze customer progressions
      const customerProgressions = new Map();
      data.metadata.customers.forEach(customer => {
        const progress = analyzeCustomerProgress(data.records, customer);
        customerProgressions.set(customer, progress);
      });

      onDataParsed({
        records: data.records,
        customerProgressions
      });

      // Clear the reports after processing
      setReports([]);

    } catch (error) {
      setErrors(prev => [...prev, `Processing error: ${error}`]);
    } finally {
      setIsProcessing(false);
    }
  }, [reports, onDataParsed]);

  const removeStoredInvoice = useCallback((invoiceId: string) => {
    removeInvoiceFromSession(invoiceId);
    setStoredInvoices(prev => prev.filter(invoice => invoice.id !== invoiceId));

    // Re-process remaining data and notify parent
    const sessionData = getSessionData();
    if (sessionData.invoices.length > 0) {
      const allRecords = sessionData.invoices.flatMap(invoice => invoice.data.records);
      const customerProgressions = new Map();

      const uniqueCustomers = Array.from(new Set(allRecords.map(r => r.customerName)));
      uniqueCustomers.forEach(customer => {
        const progress = analyzeCustomerProgress(allRecords, customer);
        customerProgressions.set(customer, progress);
      });

      onDataParsed({
        records: allRecords,
        customerProgressions
      });
    } else {
      onClearData();
    }
  }, [onDataParsed, onClearData]);

  const clearAllData = () => {
    setReports([]);
    setStoredInvoices([]);
    setErrors([]);
    clearSessionData();
    onClearData();
  };

  const getPeriodFromFileName = (fileName: string): string => {
    // Extract date from filename: "Alpine 6.25 Sales Report.TXT" -> "2025-06"
    const match = fileName.match(/(\d+)\.(\d+)/);
    if (match) {
      const [, month, year] = match;
      return `20${year}-${month.padStart(2, '0')}`;
    }

    // Default to current date if parsing fails
    return new Date().toISOString().substring(0, 7);
  };

  return (
    <Card className="bg-white shadow-lg">
      <CardHeader className="p-4 sm:p-6">
        <CardTitle className="text-base sm:text-lg font-semibold flex items-center gap-2">
          <FileText className="w-5 h-5 text-green-500" />
          Alpine Distributor Reports
        </CardTitle>

        <div className="mt-2 text-sm text-gray-600">
          Upload Alpine TXT sales report files to analyze customer progression across time periods
        </div>
      </CardHeader>

      <CardContent className="p-4 sm:p-6 pt-0">
        {/* File Upload */}
        <div className="space-y-6">
          <div className="space-y-4">
            <h3 className="font-medium text-gray-900">Upload Alpine Reports</h3>

            <div className="border-2 border-dashed border-gray-300 rounded-lg p-6 text-center">
              <input
                type="file"
                accept=".txt"
                onChange={(e) => {
                  const file = e.target.files?.[0];
                  if (file) {
                    const period = getPeriodFromFileName(file.name);
                    handleFileUpload(file, period);
                  }
                }}
                className="hidden"
                id="alpine-file-upload"
                multiple
              />
              <label htmlFor="alpine-file-upload" className="cursor-pointer">
                <Upload className="w-8 h-8 mx-auto mb-2 text-gray-400" />
                <p className="text-sm text-gray-600 mb-2">Click to upload Alpine TXT reports</p>
                <p className="text-xs text-gray-500">Supports multiple files • Auto-detects periods</p>
              </label>
            </div>
          </div>

          {/* Pending Reports */}
          {reports.length > 0 && (
            <div className="space-y-4">
              <h3 className="font-medium text-gray-900">Pending Reports ({reports.length})</h3>
              <div className="space-y-3">
                {reports.map((report, index) => (
                  <div key={index} className="bg-yellow-50 border border-yellow-200 rounded-lg p-3 flex items-center justify-between">
                    <div className="flex items-center gap-3">
                      <FileText className="w-4 h-4 text-yellow-600" />
                      <div>
                        <div className="text-sm font-medium">{report.file?.name}</div>
                        <div className="text-xs text-gray-500">Period: {report.period}</div>
                      </div>
                    </div>
                    <Button
                      variant="outline"
                      size="sm"
                      onClick={() => setReports(prev => prev.filter((_, i) => i !== index))}
                      className="text-red-600 hover:text-red-700"
                    >
                      <X className="w-4 h-4" />
                    </Button>
                  </div>
                ))}

                {/* Process Reports Button */}
                <Button
                  onClick={processReports}
                  disabled={isProcessing}
                  className="w-full"
                >
                  {isProcessing ? (
                    <div className="flex items-center gap-2">
                      <div className="animate-spin rounded-full h-4 w-4 border-b-2 border-white"></div>
                      Processing Reports...
                    </div>
                  ) : (
                    `Process ${reports.length} Report${reports.length !== 1 ? 's' : ''}`
                  )}
                </Button>
              </div>
            </div>
          )}

          {/* Stored Invoices */}
          <div className="space-y-4">
            <h3 className="font-medium text-gray-900">Stored Invoices ({storedInvoices.length})</h3>

            {storedInvoices.length === 0 ? (
              <div className="text-center py-8 text-gray-500">
                <FileText className="w-12 h-12 mx-auto mb-4 text-gray-300" />
                <p className="text-sm">No invoices stored yet</p>
              </div>
            ) : (
              <div className="space-y-3">
                {storedInvoices.map((invoice) => (
                  <div key={invoice.id} className="bg-green-50 border border-green-200 rounded-lg p-3 flex items-center justify-between">
                    <div className="flex items-center gap-3">
                      <CheckCircle className="w-4 h-4 text-green-600" />
                      <div className="flex-1">
                        <div className="text-sm font-medium">{invoice.fileName}</div>
                        <div className="text-xs text-gray-500">
                          Period: {invoice.period} • Uploaded: {new Date(invoice.uploadDate).toLocaleDateString()}
                        </div>
                        <div className="text-xs text-gray-500">
                          Records: {invoice.data.records.length} • Revenue: ${invoice.data.metadata.totalRevenue.toFixed(2)}
                        </div>
                      </div>
                    </div>
                    <Button
                      variant="outline"
                      size="sm"
                      onClick={() => removeStoredInvoice(invoice.id)}
                      className="text-red-600 hover:text-red-700"
                      title="Remove invoice"
                    >
                      <Trash2 className="w-4 h-4" />
                    </Button>
                  </div>
                ))}
              </div>
            )}
          </div>
        </div>

        {/* Errors */}
        {errors.length > 0 && (
          <div className="mt-6 p-4 bg-red-50 border border-red-200 rounded-lg">
            <div className="flex items-center gap-2 mb-2">
              <AlertCircle className="w-4 h-4 text-red-600" />
              <span className="text-sm font-medium text-red-700">Processing Errors</span>
            </div>
            <div className="text-sm text-red-600 space-y-1">
              {errors.map((error, index) => (
                <div key={index}>{error}</div>
              ))}
            </div>
          </div>
        )}

        {/* Summary */}
        {(reports.length > 0 || storedInvoices.length > 0) && (
          <div className="mt-6 p-4 bg-blue-50 border border-blue-200 rounded-lg">
            <div className="flex items-center gap-2 mb-2">
              <CheckCircle className="w-4 h-4 text-blue-600" />
              <span className="text-sm font-medium text-blue-700">Data Summary</span>
            </div>
            <div className="text-sm text-blue-600 space-y-1">
              {reports.length > 0 && (
                <p>• {reports.length} Alpine report{reports.length !== 1 ? 's' : ''} ready for processing</p>
              )}
              {storedInvoices.length > 0 && (
                <>
                  <p>• {storedInvoices.length} invoice{storedInvoices.length !== 1 ? 's' : ''} stored in session</p>
                  <p>• Periods: {Array.from(new Set(storedInvoices.map(i => i.period))).sort().join(', ')}</p>
                  <p>• Total records: {storedInvoices.reduce((sum, invoice) => sum + invoice.data.records.length, 0)}</p>
                </>
              )}
              <p>• Data persists across browser sessions</p>
            </div>
          </div>
        )}

        {/* Action Buttons */}
        <div className="flex justify-end gap-3 mt-6 pt-4 border-t">
          <Button
            variant="outline"
            size="sm"
            onClick={clearAllData}
            disabled={reports.length === 0 && storedInvoices.length === 0}
          >
            Clear All Data
          </Button>

          {(reports.length > 0 || storedInvoices.length > 0) && (
            <div className="text-sm text-gray-600 flex items-center">
              {storedInvoices.length > 0 ? 'Alpine data ready for analysis ✨' : 'Ready to analyze Alpine customer trends ✨'}
            </div>
          )}
        </div>
      </CardContent>
    </Card>
  );
};

export default AlpineReportUpload;
